import React, { Component } from "react";
import { getMovies } from "../services/fakeMovieService";

class Movie extends Component {
  state = {
    movies: getMovies()
  };
  render() {
    return (
      <div>
        <div className="table">
          <table>
            <thead>
              <tr>
                <th Title />
                <th Genre />
                <th Stock />
                <th Rate />
              </tr>
            </thead>
            <tbody>
              {this.state.movies.map(movie => (
                <tr>
                  <td />
                  <td />
                  <td />
                  <td />
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    );
  }
}

export default Movie;
